Actionscript.script:
_parent.攻击呐喊();
_root.播放音效("阎魔刀用力横斩.wav");
_root.播放音效("阎魔刀用力竖斩.wav");

function 狂野攻击(子弹威力, Z轴攻击范围, 击倒率, 水平击退速度, 垂直击退速度)
{
	var 子弹参数 = new Object();
	子弹参数.子弹威力 = 子弹威力;
	if (_parent.被动技能.刀剑攻击 && _parent.被动技能.刀剑攻击.启用)
	{
		子弹参数.子弹威力 +=  _parent.刀属性.power * _parent.被动技能.刀剑攻击.等级 * 0.075;
	}
	if (_parent.mp攻击加成)
	{
		子弹参数.子弹威力 += _parent.mp攻击加成;
	}
	子弹参数.子弹威力 += _parent.空手攻击力 * 0.3 * Math.min((_parent.重量 + _parent.体重)/100 , 2);
	子弹参数.Z轴攻击范围 = Z轴攻击范围;
	子弹参数.击倒率 = 击倒率;
	子弹参数.水平击退速度 = 水平击退速度;
	子弹参数.垂直击退速度 = 垂直击退速度;

	_parent.刀口位置生成子弹(_parent, 子弹参数);
}

子弹威力 = _parent.空手攻击力 / 5 + _parent.刀属性.power * 2;
Z轴攻击范围 = 30;
击倒率 = 2;
水平击退速度 = 10;
狂野攻击(子弹威力, Z轴攻击范围, 击倒率, 水平击退速度);

